import BuggyCounter from './BuggyCounter';
import MyErrorBoundary from './MyErrorBoundary';
import Navigation from './Navigation';
import './index.css'

export class Home extends Component{
    render(){
        return(
            <div style={{ backgroundColor: "#303030", color: "white" }}>
            <div
              style={{
                display: "flex",
                alignItems: "flex-start",
                padding: "20px",
              }}
            >
              <img
                src="/leave.png"
                alt="leaving"
                style={{  width: "70%", height: "auto", alignSelf: "flex-start" }}
              />
              <div
                style={{
                  textAlign: "left",
                  fontFamily: "'Yesava One', sans-serif",
                  fontSize: "35px",
                }}
              >
                <h3
                  className="justify-content-center"
                  style={{
                    fontWeight: "bold",
                    fontSize: "100px",
                    fontFamily: "Yesava One",
                  }}
                >
                  Do Customers
                </h3>
                <h3
                  className="justify-content-center"
                  style={{
                    fontWeight: "bold",
                    fontSize: "100px",
                    fontFamily: "Yesava One",
                  }}
                >
                  Leave your
                </h3>
                <h3
                  className="justify-content-center"
                  style={{
                    fontWeight: "bold",
                    fontSize: "100px",
                    fontFamily: "Yesava One",
                  }}
                >
                  Company?
                </h3>
              </div>
            </div>
            <div
              style={{
                display: "flex",
                alignItems: "center",
                padding: "20px",
              }}
            >
              <div style={{ textAlign: "left", marginRight: "20px" }}>
                <h3 style={{ fontSize: "35px", fontWeight: "bold" }}>
                  Our app provides the solution
                </h3>
                <p style={{ fontSize: "20px" }}>
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed non
                  risus. Suspendisse lectus tortor, dignissim sit amet, adipiscing
                  nec, ultricies sed, dolor. Cras elementum ultrices diam. Maecenas
                  ligula massa, varius a, semper congue, euismod non, mi. Proin
                  porttitor, orci nec nonummy molestie, enim est eleifend mi, non
                  fermentum diam nisl sit amet erat. Duis semper.
                </p>
              </div>
              <img
                src="/b.jpg"
                alt="app solution"
                style={{ width: "300%", height: "auto", marginTop: "-40px" }}
              />
            </div>
          </div>

        )
    }
}
